package main

import (
	"fmt"
	"strings"
)

func main() {
	fmt.Println("December 5th, 2018")

	input := []byte(``)
	// input := []byte(`dabAcCaCBAcCcaDA`)
	var newInput []byte
	reactionOccured := true
	reaction := input
	for reactionOccured {
		reactionOccured = false
		for i := 0; i < len(reaction); i++ {
			first := string(reaction[i])
			second := ""
			if i < len(reaction)-1 {
				second = string(reaction[i+1])
			}

			// fmt.Printf("letters: %s%s\n", first, second)

			if first != second && strings.ToUpper(first) == strings.ToUpper(second) {
				// fmt.Printf("Reaction!\n")
				reactionOccured = true
				i++
			} else {
				newInput = append(newInput, reaction[i])
			}
			// fmt.Printf("New reaction: %s\n", reaction)
		}
		// fmt.Printf("Inputs:\n\t%s\n\t%s\n", reaction, newInput)
		reaction = newInput
		newInput = []byte{}
	}
	fmt.Printf("Result (part 1): %v\n", len(reaction))

	smallest := 9999999999
	var smallestLetter byte
	letters := []byte{
		'a',
		'b',
		'c',
		'd',
		'e',
		'f',
		'g',
		'h',
		'i',
		'j',
		'k',
		'l',
		'm',
		'n',
		'o',
		'p',
		'q',
		'r',
		's',
		't',
		'u',
		'v',
		'w',
		'x',
		'y',
		'z',
	}
	for j := 0; j < len(letters); j++ {
		tempinput := strings.Replace(string(input), string(letters[j]), "", -1)
		tempinput = strings.Replace(tempinput, strings.ToUpper(string(letters[j])), "", -1)
		localInput := []byte(tempinput)
		// fmt.Printf("BEFORE: %s\n", localInput)

		reactionOccured = true
		for reactionOccured {
			reactionOccured = false
			for i := 0; i < len(localInput); i++ {
				first := string(localInput[i])
				second := ""
				if i < len(localInput)-1 {
					second = string(localInput[i+1])
				}

				// fmt.Printf("letters: %s%s\n", first, second)

				if first != second && strings.ToUpper(first) == strings.ToUpper(second) {
					reactionOccured = true
					i++
				} else {
					newInput = append(newInput, localInput[i])
				}
			}
			localInput = newInput
			newInput = []byte{}
		}

		// fmt.Printf("%v (%v)\n", string(letters[j]), len(localInput))
		// fmt.Printf("AFTER: %s\n", localInput)
		if len(localInput) < smallest {
			smallest = len(localInput)
			smallestLetter = letters[j]
		}
	}
	fmt.Printf("Result (part 2): %s (%d)\n", string(smallestLetter), smallest)
}
